(function( global ) {
  var obj = {};
  obj.showLoading = function(selector, action) {
    var preloader = '<img class="center-block" src="/media/portfolio/img/ajax-loader.gif" alt="Prealoader." style="padding: 5% 0;"/>';
    if (action === 'html')
      $(selector).html(preloader);
    else
      $(selector).append(preloader);
  }
  
  global.$present = obj;
})( window );

$(document).on('ready', function() {
  $('.preloader').fadeOut(800);
  $('.curtains').fadeOut(1000);
  
  // Each link is opened in a new window.
  $('.anchor').on('click', function(evt) {
    var url = $(this).attr('href');
    window.open(url);
    evt.preventDefault();
  });// end click
  // Transition to a section.
  
  $('body').on('click', 'a.item__text, #btnUp', function(event) {
    var $this = $(this);
    $('html, body').stop().animate({scrollTop: $($this.attr('href')).offset().top},1500,'easeInOutExpo');
    event.preventDefault();
  });// end click
  
  var $btnUp = $('#btnUp');
  
  $btnUp.hide();
  
  $(window).scroll(function() {
    
    if ($(this).scrollTop() > 150) {
      $btnUp.fadeIn(700);
    } else {
      $btnUp.fadeOut(1000);
    }
  });// end scroll
  
  $('body').scrollspy({target: ".navbar-fixed-top", offset: 50}); // end scrollspy
  
  $('#navbarToggle').blur(function(e) {
    var screenWidth = window.innerWidth; 
    if (screenWidth < 768)
      $("#collapsable").collapse('hide');
    
  });
  $('#typed').typed({
    stringsElement: $('#typed-strings'),
    contentType: 'html',
    typeSpeed: 35,
    startDelay: 500,
    backSpeed: 10,
    loop: true
  });
  $(document)
    .on('input propertychange', '.elemForm' , function(e) {
      $(this).toggleClass('elemForm-filled',!! $(e.target).val());
    })
    .on('focus', '.elemForm', function() {
      $(this).addClass('elemForm-focused');
    })
    .on('blur', '.elemForm', function() {
      $(this).removeClass('elemForm-focused');
    });
  
  $('#id_phone').mask('0 (000) 000 00 00');
  
  $(document).on('input propertychange', '#connectMe', function() {
    var $name = $('#id_name');
    
    var str = $name
      .val()
      .toLowerCase()
      .split(' ')
      .map(fixWord)
      .join(' ');
  
    function fixWord( word ) {
       return word.replace(word.charAt(0), word.charAt(0).toUpperCase()); 
    }
    
    $name.val(str);
  });
  
  $(document).on('submit', '#connectMe', function(e) {
    e.preventDefault();
    
    $present.showLoading('#formWrapper', 'append');
    $(this).hide('fast');
    
    sendEmail();
  });// end submit
  
  function sendEmail() {
    var name = $('#id_name').val(),
        email = $('#id_email').val(),
        phone = $('#id_phone').val(),
        message = $('#id_message').val(),
        sendData = {
          'name': name,
          'email': email,
          'phone': phone,
          'message': message
        },
        csrftoken = Cookies.get('csrftoken'),
        $formWrapper = $('#formWrapper');
    
    function csrfSafeMethod(method) {
      return (/^(GET|HEAD|OPTIONS|TRACE)$/.test(method));
    }
    $.ajaxSetup({
        url: '/success/',
        type: 'POST',
        beforeSend: function(xhr, settings) {
            if (!csrfSafeMethod(settings.type) && !this.crossDomain) {
                xhr.setRequestHeader("X-CSRFToken", csrftoken);
            }
        }
    });
    
    $.ajax({
      data: sendData,
      success: function(respond) {
        $formWrapper.html(respond);
      },
      error : function(xhr,errmsg,err) {
        $('#connectForm').show('fast');
        $formWrapper.find('img').remove();
      }
    });
  }
  $('.tooltip').tooltipster();
});//end ready
